import React from 'react';

const Home = () => {
  return (
    <div className="container mx-auto my-8">
      <h2 className="text-4xl font-bold mb-4">Welcome to Our Luxury Retirement Home</h2>
      <p className="text-lg">Providing top-notch assisted living facilities with personalized care and luxurious amenities for those aged 50+.</p>
      <button className="mt-6 bg-blue-600 text-white px-4 py-2 rounded">Learn More</button>
    </div>
  );
};

export default Home;
